<!DOCTYPE html>
<html>
 <head>
  <meta name="description" content="Dashboard Output" />
  <meta name="keywords" content="Epi, Info, Dashboard" />
  <meta name="author" content="Epi Info 7" />
  <meta http-equiv="content-type" content="text/html;charset=UTF-8" />
  <style type="text/css">
            
body 
{
	background-color: white;
	font-family: Calibri, Arial, sans-serif;
	font-size: 11pt;
}
    
td 
{
	font-family: Calibri, Arial, sans-serif;
	font-size: 13px;
	border-right: 1px solid rgb(23, 54, 93);
	border-bottom: 1px solid rgb(23, 54, 93);
	text-align: right;
	padding-left: 3px;
	padding-right: 3px;
	padding-top: 2px;
	padding-bottom: 2px;
}
    
td.blank 
{
	border-right: 0px solid rgb(23, 54, 93);
	border-bottom: 0px solid rgb(23, 54, 93);
}
    
td.noborder 
{
	border-right: 0px solid rgb(23, 54, 93);
	border-bottom: 0px solid rgb(23, 54, 93);
}
    
td.twobyTwoColoredSquareCell 
{
	border-right: 0px solid rgb(23, 54, 93);
	border-bottom: 0px solid rgb(23, 54, 93);
	padding-left: 0px;
	padding-right: 0px;
	padding-top: 0px;
	padding-bottom: 0px;
}
    
td.value 
{
	text-align: left;
}
    
td.highlightedRow 
{
	font-weight: bold;
	background-color: rgb(217, 150, 148);
}
    
tr.altcolor
{
	background-color: rgb(255, 255, 255);
}
    
th
{
	font-family: Calibri, sans-serif;
	background-color: #4a7ac9;
	font-weight: bold;
	color: white;
	padding-left: 5px;
	padding-right: 5px;
	padding-top: 3px;
	padding-bottom: 3px;
	border-right: 1px solid rgb(23, 54, 93);
	border-bottom: 1px solid rgb(23, 54, 93);
	min-width: 50px;
}
    
h1
{
	color: #4a7ac9;
	font-family: Cambria, 'Times New Roman', serif;
}
    
h2
{
	font-family: Cambria, 'Times New Roman', serif;
}
h2.gadgetHeading
{
	visibility: hidden;
	height: 1px;
}
p.gadgetOptions
{
	visibility: hidden;
	height: 1px;
}
p.summary
{
	margin-left: 20px;
	margin-right: 20px;
}
    
p.gadgetSummary
{
	font-size: 11pt;
	font-family: Calibri, Arial, Verdana, sans-serif;
}
    
table 
{
	border-left: 1px solid rgb(23, 54, 93);
	border-top: 1px solid rgb(23, 54, 93);
}
    
table.noborder 
{
	border-left: 0px solid rgb(23, 54, 93);
	border-top: 0px solid rgb(23, 54, 93);
}
    
table.twoByTwoColoredSquares 
{
	border-left: 0px solid rgb(23, 54, 93);
	border-top: 0px solid rgb(23, 54, 93);
	width: 200px;
	height: 200px;
}
    
div.percentBar
{
	height: 8px;
	background-color: rgb(34, 177, 76);
}
    
.total
{
	font-weight: bold;
}
    
.warning
{
	font-weight: bold;
	color: red;
}
    
.bold
{
	font-weight: bold;
}
    
caption
{
	font-weight: bold;
}
    
  </style>
    
  <title>Dashboard Output</title>
 </head>
<body>
<h1>Linelist by Lab test</h1>
<hr>
 
<h2 class="gadgetHeading">Line List</h2>
<p><small><strong>Ordinal '6' exceeds the maximum number.
Parameter name: ordinal</strong></small></p>
<div style="height: 7px;"></div>
<table border="0" cellpadding="0" cellspacing="0">
</table>

<p>&nbsp;</p>
 
</body>
</html>
